import React from "react";
import logo from "../images/aranyagiri1.png";

const Header = () =>
{
    return(
        
            <div className= "ui segment">
            
            <div class="ui grid">
  <div class="four wide column">    <img className="ui left floated small image" src={logo} alt="Header" style={{border:"1px red solid"}}/> </div>
  <div class="four wide column"> <h1 class="ui center aligned icon header"
                        style={{color:"red"}} >        
                            अरण्यगिरी फार्म हाऊस
                    </h1> </div>
  <div class="four wide column"> <button class="medium ui button">
                         Bookings
                    </button></div>
</div>
               
            </div>
    );
};

export default Header;
